class Solution {
    fun accountBalanceAfterPurchase(purchaseAmount: Int): Int {
        // Calculate the remainder when dividing by 10
        val remainder = purchaseAmount % 10

        // Determine the rounded amount
        val roundedAmount = if (remainder == 0) {
            purchaseAmount
        } else if (remainder <= 5) {
            purchaseAmount - remainder
        } else {
            purchaseAmount + (10 - remainder)
        }

        // Subtract the rounded amount from the initial balance and return the result
        return 100 - roundedAmount
    }
}
